    false,nt"url": null,nt"notes": "This project was completed by Aerometric,
    Inc. under USGS Contract No. 07CRCN0002, Task Order No. 070020009. This delivery
    contains point cloud data in LAS 1.1 format, classified in the following manner.
    Class 1: Unclassified, Class 2: Ground, Class 7: Low Point (Noise), Class 9: Water,
    Class 10: High Point (Noise), Class 12: Overlap, and Class 17: Port The following
    are the collection parameters and equipment used to create these data sets. Aircraft:
    Cessna 320 (N3443Q) and Piper Navajo (N6GR) Lidar System: Optech ALTM Gemini (03SEN145)
    Approximate Collection Altitude (Above Mean Terrain): 1800 meters Ground Speed:
    145 kts Pulse Rate Frequency: 70 kHz Mirror Scan Frequency: 62.6 Hz Scan Angle (+/-):
    5.3 degrees Beam Divergence: Narrow (0.25 mrad) Accuracy statements are based on
    areas of moderate terrain, with points classified as ground. Diminished accuracies
    are to be expected in areas of extreme terrain and dense vegetation. The accuracy
    of each point is expected to meet the vertical accuracy standard. Derived products
    may be less accurate in areas of extreme terrain and dense vegetation due to a lesser
    number of points defining the ground in these areas. Classified data sets such as
    this one may have varying posting due to some pulses not reaching the ground.",nt"owner_org":
